d_6352521e72c06'),(1804,49,'come_funziona_row_2_come_funziona_row_2_sottotitolo','Per merito di un’innovativa tecnologia, grazie a <strong>PrestaKey</strong> puoi trovare la migliore formula di finanziamento per le tue esigenze. In pochi click avrai una risposta in breve tempo alla tua richiesta di credito e potrai scegliere di essere contattato dai nostri partner finanziari che ti offriranno la soluzione più adatta a te. Affidandoti ai nostri partner otterrai la liquidità necessaria per i tuoi progetti <strong>entro cinque giorni lavorativi. (*)</strong>\r\n\r\nNiente più burocrazia, nessun appuntamento in banca, zero ricerche in rete. Dimentica il tempo perso: con <strong>PrestaKey</strong> avrai il supporto necessario per la tua richiesta di finanziamento e il tuo credito.\"\r\n<p style=\"font-size: 10px; margin-top: 15px;\"><strong>(*) i tempi possono variare in funzione dei tempi di allineamento tra l’Istituto Bancario erogante e l’Istituto Bancario del richiedente.</strong></p>'),(1805,49,'_come_funziona_row_2_come_funziona_row_2_sottotitolo','field_6352521e76600'),(1806,49,'come_funziona_row_2',''),(1807,49,'_come_funziona_row_2','field_6352521c8d6ac'),(1808,49,'come_funziona_row_3_come_funziona_row_3_titolo','Apri le porte del credito con <strong>PrestaKey</strong>.'),(1809,49,'_come_funziona_row_3_come_funziona_row_3_titolo','field_635252263f921'),(1810,49,'come_funziona_row_3_come_funziona_row_3_sottotitolo','Grazie alla <strong>tecnologia avanzata di PrestaKey</strong>, in pochi minuti privati e aziende avranno l\'esito della richiesta di finanziamento, la giusta valutazione del merito di credito e, di conseguenza, la corretta liquidità. <strong>L’intero processo è online, gratuito e senza impegno.</strong>'),(1811,49,'_come_funziona_row_3_come_funziona_row_3_sottotitolo','field_635252264342c'),(1812,49,'come_funziona_row_3',''),(1813,49,'_come_funziona_row_3','field_6352521c98889'),(1814,49,'come_funziona_row_4_come_funziona_row_4_titolo','Realizza i tuoi progetti, <strong>PrestaKey</strong> ti dà credito.'),(1815,49,'_come_funziona_row_4_come_funziona_row_4_titolo','field_635252203e574'),(1816,49,'come_funziona_row_4_come_funziona_row_4_sottotitolo','La piattaforma si rivolge ad <a href=\"/sono-una-azienda/\">aziende, ditte individuali</a> e <a href=\"/sono-un-privato/\">privati</a>. In pochi minuti <strong>PrestaKey</strong> analizza la tua capacità finanziaria in modo esaustivo e ti suggerisce il prodotto più adatto al tuo profilo. L’obiettivo è quello di <strong>ridurre al minimo il rischio di veder rifiutate le tue richieste di liquidità</strong> da parte di banche o istituti di credito.\r\n\r\nL’intero processo si svolge online, senza noiosi appuntamenti in filiale e senza dover attendere l’incontro con il gestore bancario. <strong>In totale sicurezza, preservando la tua privacy</strong>.'),(1817,49,'_come_funziona_row_4_come_funziona_row_4_sottotitolo','field_63525220420ed'),(1818,49,'come_funziona_row_4_come_funziona_row_4_titolo_2','Come funziona la <strong>procedura</strong>?'),(1819,49,'_come_funziona_row_4_come_funziona_row_4_titolo_2','field_6352522045d62'),(1820,49,'come_funziona_row_4_come_funziona_row_4_titolo_3','<strong>In qualsiasi momento</strong> potrai chiedere l’intervento di un nostro operatore che, al telefono, ti guiderà nella procedura.'),(1821,49,'_come_funziona_row_4_come_funziona_row_4_titolo_3','field_6352522049802'),(1822,49,'come_funziona_row_4_come_funziona_row_4_titolo_asterisco','<strong>* Perché la piattaforma ha bisogno degli estratti conto delle mie banche?</strong>'),(1823,49,'_come_funziona_row_4_come_funziona_row_4_titolo_asterisco','field_635252204d29c'),(1824,49,'come_funziona_row_4_come_funziona_row_4_descrizione_asterisco','Per farti la miglior proposta possibile, Prestaky ha bisogno di alcune informazioni sui conti delle banche che utilizzi. Ti chiederà, quindi, di condividere questi dettagli collegando i tuoi conti alla richiesta di finanziamento. Per farlo, ti baster