_row_2_noi_row_2_sottotitolo','field_6352628a2649b'),(3425,347,'noi_row_2',''),(3426,347,'_noi_row_2','field_6352628a26499'),(3427,347,'noi_row_3_noi_row_3_titolo','La missione di <strong>PrestaKey</strong> è lo sviluppo di un sistema di accesso al credito basato <strong>sulla giusta valutazione del merito di credito.</strong>\r\n\r\nAttraverso la tecnologia offriamo accesso a servizi bancari a a chi ha avuto difficolta a fruirne fino ad oggi. <strong>Una sorta di democratizzazione del credito.</strong>\r\n\r\nDa qui nasce il concetto del payoff <strong>\"Digitalizzare le decisioni\"</strong>, che mette insieme i due concetti fondanti di PrestaKey. Il primo è il <strong>digital</strong>, quindi il finanziamento da richiedere online, anche da mobile, in pochi click. Il secondo verte sul fatto che grazie alla tecnologia della piattaforma, in pochi minuti <strong>aziende e privati avranno l\'esito della richiesta di finanziamento, la giusta valutazione del merito di credito e, di conseguenza, la corretta liquidità.</strong>'),(3428,347,'_noi_row_3_noi_row_3_titolo','field_635263260b153'),(3429,347,'noi_row_3',''),(3430,347,'_noi_row_3','field_635263260b152'),(3431,347,'noi_row_4_noi_row_4_titolo','Il team di <strong>PrestaKey</strong>.'),(3432,347,'_noi_row_4_noi_row_4_titolo','field_6352636f17972'),(3433,347,'noi_row_4',''),(3434,347,'_noi_row_4','field_6352636f17971'),(3435,347,'noi_row_5_noi_row_5_titolo','Il team partner di <strong>PrestaKey</strong>.'),(3436,347,'_noi_row_5_noi_row_5_titolo','field_635263ad00647'),(3437,347,'noi_row_5',''),(3438,347,'_noi_row_5','field_635263ad00646'),(3439,347,'noi_row_6_noi_row_6_titolo','Scegli il <strong>finanziamento giusto</strong> per le <strong>tue necessità</strong>.'),(3440,347,'_noi_row_6_noi_row_6_titolo','field_635263cc4c790'),(3441,347,'noi_row_6_noi_row_6_sottotitolo','<strong>Niente più burocrazia, nessun appuntamento in banca, zero ricerche in rete.</strong>\r\n\r\nDimentica il tempo perso: con <strong>PrestaKey</