ona_row_3_come_funziona_row_3_sottotitolo','Grazie alla <strong>tecnologia avanzata di PrestaKey</strong>, in pochi minuti privati e aziende avranno l\'esito della richiesta di finanziamento, la giusta valutazione del merito di credito e, di conseguenza, la corretta liquidità. <strong>L’intero processo è online, gratuito e senza impegno.</strong>'),(4150,363,'_come_funziona_row_3_come_funziona_row_3_sottotitolo','field_635252264342c'),(4151,363,'come_funziona_row_3',''),(4152,363,'_come_funziona_row_3','field_6352521c98889'),(4153,363,'come_funziona_row_4_come_funziona_row_4_titolo','Realizza i tuoi progetti, <strong>PrestaKey</strong> ti dà credito.'),(4154,363,'_come_funziona_row_4_come_funziona_row_4_titolo','field_635252203e574'),(4155,363,'come_funziona_row_4_come_funziona_row_4_sottotitolo','La piattaforma si rivolge ad <a href=\"/sono-una-azienda/\">aziende, ditte individuali</a> e <a href=\"/sono-un-privato/\">privati</a>. In pochi minuti <strong>PrestaKey</strong> analizza la tua capacità finanziaria in modo esaustivo e ti suggerisce il prodotto più adatto al tuo profilo. L’obiettivo è quello di <strong>ridurre al minimo il rischio di veder rifiutate le tue richieste di liquidità</strong> da parte di banche o istituti di credito.\r\n\r\nL’intero processo si svolge online, senza noiosi appuntamenti in filiale e senza dover attendere l’incontro con il gestore bancario. <strong>In totale sicurezza, preservando la tua privacy</strong>.'),(4156,363,'_come_funziona_row_4_come_funziona_row_4_sottotitolo','field_63525220420ed'),(4157,363,'come_funziona_row_4_come_funziona_row_4_titolo_2','Come funziona la <strong>procedura</strong>?'),(4158,363,'_come_funziona_row_4_come_funziona_row_4_titolo_2','field_6352522045d62'),(4159,363,'come_funziona_row_4_come_funziona_row_4_titolo_3','<strong>In qualsiasi momento</strong> potrai chiedere l’intervento di un nostro operatore che, al telefono, ti guiderà nella procedura.'),(4160,363,'_come_funziona_row_4_come_funziona_row_4_titolo_3','field_6352522049802'),(4161,363,'come_funziona_row_4_come_funziona_row_4_titolo_asterisco','<strong>* Perché la piattaforma ha bisogno degli estratti conto delle mie banche?</strong>'),(4162,363,'_come_funziona_row_4_come_funziona_row_4_titolo_asterisco','field_635252204d29c'),(4163,363,'come_funziona_row_4_come_funziona_row_4_descrizione_asterisco','Per farti la miglior proposta possibile, Prestaky ha bisogno di alcune informazioni sui conti delle banche che utilizzi. Ti chiederà, quindi, di condividere questi dettagli collegando i tuoi conti alla richiesta di finanziamento. Per farlo, ti basterà accedereal tuo internet banking durante il processo, basteranno pochi click. Grazie all’Open Banking, questi passaggi si svolgeranno nella massima sicurezza e nel pieno rispetto della tua privacy. In pochi minuti otterrai una risposta alla tua richiesta.'),(4164,363,'_come_funziona_row_4_come_funziona_row_4_descrizione_asterisco','field_6352522050d3b'),(4165,363,'come_funziona_row_4',''),(4166,363,'_come_funziona_row_4','field_6352521c91374'),(4167,363,'come_funziona_row_5_come_funziona_row_5_titolo','Non sei ancora convinto?'),(4168,363,'_come_funziona_row_5_come_funziona_row_5_titolo','field_63525228553f9'),(4169,363,'come_funziona_row_5_come_funziona_row_5_sottotitolo','Il <strong>Servizio Clienti</strong> è a tua disposizione. Se hai bisogno di supporto <strong>non esitare a contattarlo</strong>.'),(4170,363,'_come_funziona_row_5_come_funziona_row_5_sottotitolo','field_6352522858ed4'),(4171,363,'come_funziona_row_5',''),(4172,363,'_come_funziona_row_5','field_6352521c9c500'),(4173,364,'azienda_row_1_azienda_row_1_titolo','<strong>Sei un’azienda</strong> alla ricerca di un <strong>finanziamento</strong> per migliorare il tuo <strong>business?</strong>'),(4174,364,'_azienda_row_1_azienda_row_1_titolo','field_63524cc5c9546'),(4175,364,'azienda_row_1_azienda_row_1_sottotitolo','Con <strong>PrestaKey</strong> puoi ottenere fino a 150.000 € nella maniera più rapi