o di XXX€ per le aziende e XXX euro per le Partite IVA.</p>\n<!-- /wp:paragraph -->','Qual è l’importo massimo che posso richiedere tramite PrestaKey?','','publish','closed','closed','','qual-e-limporto-massimo-che-posso-richiedere-tramite-prestakey','','','2022-09-26 17:00:08','2022-09-26 15:00:08','',0,'http://prestakey/?post_type=faq&#038;p=53',0,'faq','',0),(54,1,'2022-09-26 17:00:37','2022-09-26 15:00:37','<!-- wp:paragraph -->\n<p>Una volta avute tutte le informazioni, riceverai una risposta alla tua richiesta entro 24/48 ore.</p>\n<!-- /wp:paragraph -->','Quanto tempo ci vuole per sapere se la mia richiesta di finanziamento è stata approvata oppure no?','','publish','closed','closed','','quanto-tempo-ci-vuole-per-sapere-se-la-mia-richiesta-di-finanziamento-e-stata-approvata-oppure-no','','','2022-09-26 17:00:38','2022-09-26 15:00:38','',0,'http://prestakey/?post_type=faq&#038;p=54',0,'faq','',0),(55,1,'2022-09-26 17:00:57','2022-09-26 15:00:57','<!-- wp:paragraph -->\n<p>In caso positivo della richiesta di finanziamento, la liquidità indicata verrà erogata entro cinque giorni lavorativi.</p>\n<!-- /wp:paragraph -->','Quanto tempo ci vuole per ottenere il finanziamento richiesto?','','publish','closed','closed','','quanto-tempo-ci-vuole-per-ottenere-il-finanziamento-richiesto','','','2022-09-26 17:00:58','2022-09-26 15:00:58','',0,'http://prestakey/?post_type=faq&#038;p=55',0,'faq','',0),(56,1,'2022-09-26 17:01:13','2022-09-26 15:01:13','','Sono una Partita IVA. Quali sono i requisiti da avere per avere un prestito?','','publish','closed','closed','','sono-una-partita-iva-quali-sono-i-requisiti-da-avere-per-avere-un-prestito','','','2022-09-26 17:01:14','2022-09-26 15:01:14','',0,'http://prestakey/?post_type=faq&#038;p=56',0,'faq','',0),(57,1,'2022-09-26 17:01:22','2022-09-26 15:01:22','','Sono un’azienda. Quali sono i requisiti da avere per avere un finanziamento?','','publish','closed','closed','','sono-unazienda-quali-sono-i-requisiti-da-avere-per-avere-un-